import React, { Component } from "react";
import axios from "axios";

class Maas360Data extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }

  async componentDidMount() {
     try {
       const response = await axios.get("/api/maas360");
       this.setState({ data: response.data });
     } catch (error) {
       console.log(error);
     }
   }


  render() {
    return (
      <div>
        <h2>Device List</h2>
        {this.state.data.length > 0 &&
          this.state.data.map((device) => (
            <div key={device.id}>
              <h3>{device.name}</h3>
              <p>OS: {device.os}</p>
            </div>
          ))}
      </div>
    );
  }
}

export default Maas360Data;
